 class Solution{
    public     //Complete this function
    //Function to check whether there is a subarray present with 0-sum or not.
    bool subArrayExists(int arr[], int n)
    {
        //Your code here
        int pre[n];
        pre[0]=arr[0];
        if(pre[0]==0)
        return true;
        for(int i=1;i<n;i++)
        {
            pre[i]=arr[i]+pre[i-1];
            if(pre[i]==0)
            return true;
        }
        map<int,int>mp;
        for(int i=0;i<n;i++)
        {
            if(mp[pre[i]]==0)
            mp[pre[i]]=i+1;
            else
            return true;

        }
        return false;
    }
};

